import React, { useEffect, useState } from "react";
import { RouteComponentProps, withRouter } from "react-router";

type BookDetailParams = {
  id: string;
};
type BookDetailProps = RouteComponentProps<BookDetailParams>;

const BookDetail: React.FC<{ match: any }> = ({ match }) => {
  useEffect(() => {
    fetchItem();
  }, []);
  //   console.log(history);

  const [item, setItem] = useState({
    id: Number,
    name: String,
  });

  const fetchItem = async () => {
    const fetchItem = await fetch(
      `https://jsonplaceholder.typicode.com/users/${match.params.id}`
    );
    const item = await fetchItem.json();
    setItem(item);
    // console.log(item);
    // const result = await axios("https://jsonplaceholder.typicode.com/users/1");
    // setdataProfile(result);
    // console.log(result.data);
  };
  console.log(item);

  return <div>Book ID: {match.params.id}</div>;
};
export default withRouter(BookDetail);
